@16kbps one thing I am jealous of from the windows side of things is what it does with a *completely empty* disk

which is to make a GPT + an ESP partition for UEFI boot

maybe tools like gparted should offer to do something similar, especially nowadays that UEFI is (finally?) everywhere

@whatever00015 It's a great point 😊
We're using GPT-3's Davinci engine, which uses models that are trained on billions of pieces of data.

Then we have done a so-called fine-tuning of that model using our additional 250K data points to super-specialize the model to this task 🙌

